import React from "react";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <>
      <div className="m-auto">
        <h1>Welcome</h1>
        <Link to='/register'>Create Account</Link> <br />
        <Link to='/login'>Login</Link> <br />
        <Link to='/product/A002'>Product</Link> <br />
        <Link to='/category/rice'>Product List</Link> <br />
        <Link to='/search/oil'>Search Product</Link> <br />
        <Link to='/cart/checkout'>Checkout</Link> <br />
        <Link to='/cart/checkout/success'>Payment Success</Link> <br />
      </div>
    </>
  );

};

export default Home;
